import React from "react";

function CreateArea()
{
    return(
        <div>
            <form>
                <input name="title" placeholder="title"/>
                <textarea name="content" placeholder="content" rows="3"/>
                <button>Add</button>
            </form>
        </div>
    )
}

export default CreateArea;
